  return (
    <div className="flex flex-row bg-neutral-300 h-screen w-screen overflow-hidden">
      <div><Sidebar/></div>
      <div className="flex-1">
        header
        <div>{<Outlet />}</div>
      </div>
    </div>
  );
};

export default Autenticate;
